import Head from 'next/head';
import styles from '../styles/Home.module.css';

export default function Home() {
	return (
		<main className="container mx-auto">
			<section
				className="necesidad h-screen w-full flex items-center justify-center"
				style={styles.necesidad - section}
			>
				<h1 className="text-xl">Una necesidad actual</h1>
			</section>
		</main>
	);
}
